import { StyleSheet, View, Text } from "react-native";

const RegistrationScreen = () => {
  return (
    <View style={styles.container}>
      <Text>Реєстрація</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    marginTop: 500,
    },
    text: {
        Font: Roboto,
        Weight: 500,
        // Size: 30,
        // LineHeight: 35.16,
        // Letter: 1 %,
        // Align: Center,
    }
});

export default RegistrationScreen;
